    function EntranceContainer() {

        function CreateBlocks() {

            const BlockContainer = document.createElement('div')
                  BlockContainer.className = 'StartAppend-block'

                  document.body.appendChild(BlockContainer);

            const BlockContainerChild = document.createElement('div')
                  BlockContainerChild.className = 'StartAppend-blockChild'

                  BlockContainer.appendChild(BlockContainerChild);

            const BlockContainerChildSpan = document.createElement('span')
                  BlockContainerChildSpan.className = 'StartAppend-blockChildSpan'
                  BlockContainerChildSpan.innerHTML = 'Retrospective [14.04.2024 release] by vk.com/drawingwithblood'

                  BlockContainerChild.appendChild(BlockContainerChildSpan);

            const BlockContainerSecondChild = document.createElement('div')
                  BlockContainerSecondChild.className = 'StartAppend-blockSecondChild'

                  BlockContainer.appendChild(BlockContainerSecondChild);

            const BlockContainerSecondChildSpan = document.createElement('span')
                  BlockContainerSecondChildSpan.className = 'StartAppend-blockSecondChildSpan'
                  BlockContainerSecondChildSpan.innerHTML = 'Menu // F9'

                  BlockContainerSecondChild.appendChild(BlockContainerSecondChildSpan);


            setTimeout(function() {

                const BlockContainerChild = document.getElementsByClassName('StartAppend-blockChild')[0];
                      BlockContainerChild.style.animation = 'appears 600ms ease-out forwards'

            }, 0);

            setTimeout(function() {

                const BlockContainerChild = document.getElementsByClassName('StartAppend-blockChild')[0];
                      BlockContainerChild.style.animation = 'disappears 600ms ease-out forwards'

            }, 2500);

            setTimeout(function() {

                const BlockContainerChild = document.getElementsByClassName('StartAppend-blockSecondChild')[0];
                      BlockContainerChild.style.animation = 'appears 600ms ease-out forwards'

            }, 2500);

            setTimeout(function() {

                const BlockContainerChild = document.getElementsByClassName('StartAppend-blockSecondChild')[0];
                      BlockContainerChild.style.animation = 'disappears 600ms ease-out forwards'

            }, 5000);

            setTimeout(function() {

                const BlockContainer = document.getElementsByClassName('StartAppend-block')[0];

                document.body.removeChild(BlockContainer);

            }, 6000);
        };

        function URLCheck() {

            if (window.location.href == 'https://tankionline.com/play/') {
                CreateBlocks();
            };

        };

        URLCheck();

    };

